import React, { useState } from 'react';

const StandingsTable = ({ standings }) => {
  const [selectedConference, setSelectedConference] = useState('All');

  const filteredStandings = standings.filter(team => 
    selectedConference === 'All' || team.conference === selectedConference
  );

  return (
    <div className="card p-6">
      <div className="flex items-center justify-between mb-6">
        <h2 className="text-xl font-semibold text-gray-900 flex items-center">
          <span className="mr-2">ðŸ“Š</span>
          League Standings
        </h2>

        <div className="flex space-x-2">
          {['All', 'East', 'West'].map((conference) => (
            <button
              key={conference}
              onClick={() => setSelectedConference(conference)}
              className={`px-4 py-2 rounded-lg text-sm font-medium transition-colors duration-200 ${
                selectedConference === conference
                  ? 'bg-nba-blue text-white'
                  : 'bg-gray-100 text-gray-700 hover:bg-gray-200'
              }`}
            >
              {conference}
            </button>
          ))}
        </div>
      </div>

      <div className="overflow-x-auto">
        <table className="w-full">
          <thead>
            <tr className="border-b border-gray-200">
              <th className="text-left py-3 px-4 font-semibold text-gray-700">Rank</th>
              <th className="text-left py-3 px-4 font-semibold text-gray-700">Team</th>
              <th className="text-center py-3 px-4 font-semibold text-gray-700">W</th>
              <th className="text-center py-3 px-4 font-semibold text-gray-700">L</th>
              <th className="text-center py-3 px-4 font-semibold text-gray-700">Win%</th>
              <th className="text-center py-3 px-4 font-semibold text-gray-700">Conf</th>
            </tr>
          </thead>
          <tbody>
            {filteredStandings.map((team, index) => (
              <tr 
                key={team.team_id || index}
                className="border-b border-gray-100 hover:bg-gray-50 transition-colors duration-150"
              >
                <td className="py-3 px-4">
                  <span className="font-medium text-gray-900">#{team.conf_rank || index + 1}</span>
                </td>
                <td className="py-3 px-4">
                  <div className="flex items-center space-x-3">
                    <div className="w-8 h-8 bg-gradient-to-br from-nba-blue to-nba-red rounded-full flex items-center justify-center text-white text-xs font-bold">
                      {team.team_name?.substring(0, 3).toUpperCase() || 'NBA'}
                    </div>
                    <span className="font-medium text-gray-900">{team.team_name}</span>
                  </div>
                </td>
                <td className="py-3 px-4 text-center">
                  <span className="font-semibold text-green-600">{team.wins}</span>
                </td>
                <td className="py-3 px-4 text-center">
                  <span className="font-semibold text-red-600">{team.losses}</span>
                </td>
                <td className="py-3 px-4 text-center">
                  <span className="font-medium text-gray-900">{(team.win_pct * 100).toFixed(1)}%</span>
                </td>
                <td className="py-3 px-4 text-center">
                  <span className={`px-2 py-1 rounded-full text-xs font-medium ${
                    team.conference === 'East' 
                      ? 'bg-blue-100 text-blue-800' 
                      : 'bg-red-100 text-red-800'
                  }`}>
                    {team.conference}
                  </span>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>

      {filteredStandings.length === 0 && (
        <div className="text-center py-8 text-gray-500">
          No standings data available
        </div>
      )}
    </div>
  );
};

export default StandingsTable;
